import React from 'react';
import { Container, Button } from 'react-bootstrap';

function Home() {
  return (
    <Container className="p-5 my-5 bg-light rounded">
      <h1>Welcome to PetShop</h1>
      <p>Your one-stop shop for all your pet needs.</p>
      <Button variant="primary" href="/products">Shop Now</Button>
    </Container>
  );
}

export default Home;
